import React from 'react';

const Cart = ({ cart, removeFromCart }) => {
  return (
    <div className="cart">
      <h2>Shopping Cart</h2>
      {cart.map(book => (
        <div key={book.id} className="cart-item">
          <h3>{book.volumeInfo.title}</h3>
          <button onClick={() => removeFromCart(book.id)}>Remove</button>
        </div>
      ))}
    </div>
  );
};

export default Cart;
